INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 401, 2, 24001, "2020/07/31 12:00:00", 0.0, 102301, 0.0, 0.0, "アヤネ", "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 2, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 402, 1, 24002, "2020/07/31 12:00:00", 2.21, 102301, 0.0, 0.0, "アヤネ", "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 2, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 403, 2, 24003, "2020/07/31 12:00:00", 0.0, 102301, 0.0, 0.0, "アヤネ", "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 2, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 701, 2, 24004, "2020/07/31 12:00:00", 1.99, 192201, 0.0, 0.0, "アサヒ", "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 1, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 702, 1, 24005, "2020/07/31 12:00:00", 2.21, 192201, 0.0, 0.0, "アサヒ", "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 2, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 703, 2, 24006, "2020/07/31 12:00:00", 3.33, 192201, 0.0, 0.0, "アサヒ", "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 1, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 801, 2, 24007, "2020/07/31 12:00:00", 0.0, 192301, 0.0, 0.0, "部員３", "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 2, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 802, 1, 24008, "2020/07/31 12:00:00", 2.68, 192301, 0.0, 0.0, "部員３", "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 2, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 803, 2, 24009, "2020/07/31 12:00:00", 0.0, 192301, 0.0, 0.0, "部員３", "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 2, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 501, 1, 24010, "2020/07/31 12:00:00", 0.0, 192501, 0.0, 0.0, "", "やった！", 1, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 502, 1, 24011, "2020/07/31 12:00:00", 0.0, 192501, 0.0, 0.0, "", "勝ったよ！", 1, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 503, 1, 24012, "2020/07/31 12:00:00", 0.0, 192501, 0.0, 0.0, "", "いい調子！", 1, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 111, 6, 24013, "2020/07/31 12:00:00", 5.33, 113501, 0.0, 0.0, "ミサト", "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 2, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 112, 1, 24014, "2020/07/31 12:00:00", 6.85, 113501, 0.0, 0.0, "ミサト", "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 2, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 113, 1, 24015, "2020/07/31 12:00:00", 3.0, 113501, 0.0, 0.0, "ミサト", "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 2, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 611, 1, 24016, "2020/07/31 12:00:00", 6.11, 192401, 0.0, 0.0, "ダイチ", "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 2, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 612, 1, 24017, "2020/07/31 12:00:00", 6.75, 192401, 0.0, 0.0, "ダイチ", "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 2, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 613, 2, 24018, "2020/07/31 12:00:00", 0.0, 192401, 0.0, 0.0, "ダイチ", "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 2, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 211, 2, 24019, "2020/07/31 12:00:00", 4.52, 113401, 0.0, 0.0, "ハツネ", "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 1, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 212, 2, 24020, "2020/07/31 12:00:00", 3.89, 113401, 0.0, 0.0, "ハツネ", "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 1, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 213, 1, 24021, "2020/07/31 12:00:00", 13.49, 113401, 0.0, 0.0, "ハツネ", "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 2, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 311, 1, 24022, "2020/07/31 12:00:00", 3.17, 106501, 0.0, 0.0, "カヤ", "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 2, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 312, 1, 24023, "2020/07/31 12:00:00", 4.42, 106501, 0.0, 0.0, "カヤ", "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 2, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 313, 6, 24024, "2020/07/31 12:00:00", 2.89, 106501, 0.0, 0.0, "カヤ", "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 1, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 421, 4, 24025, "2020/07/31 12:00:00", 3.71, 102301, 0.0, 0.0, "アヤネ", "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 3, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 721, 2, 24026, "2020/07/31 12:00:00", 5.1, 192201, 0.0, 0.0, "アサヒ", "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 1, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 821, 1, 24027, "2020/07/31 12:00:00", 4.34, 192301, 0.0, 0.0, "部員３", "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 3, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 521, 1, 24028, "2020/07/31 12:00:00", 0.0, 192501, 0.0, 0.0, "", "いい勝負だったよ\nまたやろうね", 1, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 101, 1, 24029, "2020/07/31 12:00:00", 5.62, 113501, 0.0, -360.0, "ミサト", "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 2, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 102, 1, 24030, "2020/07/31 12:00:00", 9.58, 113501, 0.0, -360.0, "ミサト", "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 2, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 103, 2, 24031, "2020/07/31 12:00:00", 0.0, 113501, 0.0, -360.0, "ミサト", "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 2, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 104, 2, 24032, "2020/07/31 12:00:00", 9.13, 113501, 0.0, -360.0, "ミサト", "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 1, 24, 10046);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", 105, 1, 24033, "2020/07/31 12:00:00", 8.27, 113501, 0.0, -360.0, "ミサト", "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 2, 24, 10046);
